select *
        , row_number() over (partition by punk_id order by evt_block_number desc, evt_index desc) as punk_id_tx_rank
from
(   select  from
            , to
            , evt_block_time
            , evt_block_time_week
            , evt_block_number
            , evt_index
            , punk_id
            , evt_tx_hash 
    from 
    (
    select  a.from
            , a.to
            , a.evt_block_time
            , date_trunc('week',a.evt_block_time) as evt_block_time_week
            , a.evt_block_number
            , a.evt_index
            , case when a.evt_tx_hash = lower('0x76d32b465ca332bbbe74f7a1834c6d354125f6950168c6123f8ab07440bc285e') and a.evt_index = 11 then 675
                when a.evt_tx_hash = lower('0x76d32b465ca332bbbe74f7a1834c6d354125f6950168c6123f8ab07440bc285e') and a.evt_index = 27 then 675
                when a.evt_tx_hash = lower('0x76d32b465ca332bbbe74f7a1834c6d354125f6950168c6123f8ab07440bc285e') and a.evt_index = 25 then 2138
                when topic1 = '0x05af636b70da6819000c49f85b21fa82081c632069bb626f30932034099107d8' then cast(bytea2numeric_v2(substring(data from 3)) as int)
                else cast(bytea2numeric_v2(substring(topic2 from 3)) as int) end as punk_id
            , a.evt_tx_hash
    from {{ source('erc20_ethereum','evt_transfer') }} a 
    inner join {{ source('ethereum','logs') }} b on a.evt_tx_hash = b.tx_hash -- and topic1 = '0x58e5d5a525e3b40bc15abaa38b5882678db1ee68befd2f60bafe3a7fd06db9e3'
    where a.contract_address = lower('0xb47e3cd837dDF8e4c57F05d70Ab865de6e193BBB') -- cryptopunks contract 
        and topic1 in   (   '0xb0e0a660b4e50f26f0b7ce75c24655fc76cc66e3334a54ff410277229fa10bd4' -- PunkNoLongerForSale
                            , '0x58e5d5a525e3b40bc15abaa38b5882678db1ee68befd2f60bafe3a7fd06db9e3' -- PunkBought
                            , '0x05af636b70da6819000c49f85b21fa82081c632069bb626f30932034099107d8' -- PunkTransfer
                        )
        {% if is_incremental() %} and a.evt_block_time >= date_trunc('day', now() - interval '1 week') {% endif %}    
    
    union all 
    
    select  cast(NULL as varchar(5)) as from
            , address as to
            , cast('2017-06-23 19:37:59' as timestamp) as evt_block_time
            , date_trunc('week',cast('2017-06-23 19:37:59' as timestamp)) as evt_block_time_week
            , cast(3919418 as int) as evt_block_number
            , cast(1 as int) as evt_index
            , punk_id
            , cast(NULL as varchar(5)) as evt_tx_hash
    from original_holders
    where {% if is_incremental() %} cast('2017-06-23 19:37:59' as timestamp) >= date_trunc('day', now() - interval '1 week') {% endif %}    
    
    ) a
    group by 1,2,3,4,5,6,7,8
) b